const Questions = () => {
  [
    {
      prompt: "What is 1+1 ?",
      optionA: "2",
      optionB: "4",
      optionC: "6",
      optionD: "7",
      answer: "optionA",
    },
    {
      prompt: "What is your nickName?",
      optionA: "QQ",
      optionB: "LOL",
      optionC: "BB",
      optionD: "tritri",
      answer: "optionC",
    },
    {
      prompt: "How are you doing?",
      optionA: "Meh",
      optionB: "Meh",
      optionC: "Meh",
      optionD: "Never been better!",
      answer: "optionD",
    },
  ];
};

export default Questions;
